#!/usr/bin/env python3
"""
Pathogen HLA Class II Binding Analysis Pipeline

This script:
1. Downloads proteome sequences from NCBI for a specified organism
2. Identifies secreted proteins using SignalP
3. Generates overlapping 15-mer peptides
4. Runs netMHCIIpan predictions against all available HLA alleles
5. Outputs results to Excel format

Author: Generated for systematic pathogen immunogenomics analysis
"""

